import React from "react";
import { Button } from "react-bootstrap";

function feladat(){
    var eset=Math.floor(Math.random() * 3)+1;
    document.getElementById("demo").innerHTML =eset;
    document.getElementById("leiras").innerHTML =eset;

}

function MesterGyak() {
    return (
    <div className="test">
        <h1 >Mester tétel gyakorló</h1>
        <br/>
        <Button variant="primary" onClick={feladat}>Új feladat</Button>
        <br/>
        <p id="demo"/>
        <p id="leiras"/>
    </div>
    )

}

export default MesterGyak;
